import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import TodoList from './List'

class App extends Component {
  render() {
    return (
      <div className="block">
      	<TodoList />
      </div>
    )
  }
}

ReactDOM.render(<App/>, document.getElementById('root'));

export default App;
